);

const AchievementItem = ({ title, description, achieved, icon }) => (
  <ListItem 
    sx={{ 
      bgcolor: achieved ? 'action.hover' : 'background.paper',
      borderRadius: 1,
      mb: 1,
      opacity: achieved ? 1 : 0.6,
    }}
  >
    <ListItemIcon>
      {achieved ? (
        <AchievementIcon color="primary" />
      ) : (
        <AchievementIcon color="disabled" />
      )}
    </ListItemIcon>
    <ListItemText 
      primary={title}
      secondary={description}
      primaryTypographyProps={{
        color: achieved ? 'primary' : 'text.primary',
        fontWeight: achieved ? 'bold' : 'normal',
      }}
    />
    {achieved && (
      <Chip 
        label="Earned" 
        color="success" 
        size="small" 
        variant="outlined"
      />
    )}
  </ListItem>
);

const ProfilePage = () => {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();
  const [tabValue, setTabValue] = useState(0);
  const [stats, setStats] = useState({
    gamesPlayed: 0,
    gamesWon: 0,
    winRate: 0,
    currentStreak: 0,
    bestTime: '--:--',
    achievements: [],
  });

  // Mock data - in a real app, this would come from an API
  const achievements = [
    { id: 1, title: 'First Win', description: 'Complete your first Sudoku puzzle', achieved: true },
    { id: 2, title: 'Speed Demon', description: 'Complete a puzzle in under 5 minutes', achieved: false },
    { id: 3, title: 'Perfectionist', description: 'Complete a puzzle without any mistakes', achieved: true },
    { id: 4, title: 'Master of Easy', description: 'Complete 10 easy puzzles', achieved: false },
    { id: 5, title: 'Weekend Warrior', description: 'Play 5 days in a row', achieved: false },
  ];

  const recentGames = [
    { id: 1, difficulty: 'Easy', time: '12:34', date: '2023-05-15', completed: true },
    { id: 2, difficulty: 'Medium', time: '24:18', date: '2023-05-14', completed: false },
    { id: 3, difficulty: 'Hard', time: '45:22', date: '2023-05-12', completed: true },
  ];

  useEffect(() => {
    // In a real app, fetch user stats from an API
    setStats({
      gamesPlayed: 15,
      gamesWon: 10,
      winRate: 67,
      currentStreak: 3,
      bestTime: '8:42',
      achievements: achievements.filter(a => a.achieved).length,
    });
  }, []);

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  if (!user) {
    navigate('/login');
    return null;
  }

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
      >
        <Paper elevation={3} sx={{ p: 4, mb: 4, borderRadius: 2 }}>
          <Grid container spacing={4} alignItems="center">
            <Grid item xs={12} md={3} sx={{ textAlign: 'center' }}>
              <StyledAvatar>
                <PersonIcon sx={{ fontSize: 60 }} />
              </StyledAvatar>
              <Typography variant="h5" component="h1" sx={{ mt: 2, mb: 1 }}>
                {user.username}
              </Typography>
              <Chip 
                label={user.role === 'admin' ? 'Admin' : 'Player'} 
                color={user.role === 'admin' ? 'secondary' : 'primary'} 
                size="small" 
                variant="outlined"
                sx={{ mb: 2 }}
              />
              <Box>
                <Button 
                  variant="outlined" 
                  color="primary" 
                  size="small"
                  onClick={handleLogout}
                  sx={{ mt: 1 }}
                >
                  Logout
                </Button>
              </Box>
            </Grid>

            <Grid item xs={12} md={9}>
              <Grid container spacing={3}>
                <Grid item xs={6} sm={4} md={3}>
                  <StatCard 
                    icon={<TrophiesIcon />} 
                    title="Games Won" 
                    value={`${stats.gamesWon}/${stats.gamesPlayed}`}
                    color="success"
                  />
                </Grid>
                <Grid item xs={6} sm={4} md={3}>
                  <StatCard 
                    icon={<ProgressIcon />} 
                    title="Win Rate" 
                    value={`${stats.winRate}%`}
                    color="info"
                  />
                </Grid>
                <Grid item xs={6} sm={4} md={3}>
                  <StatCard 
                    icon={<TimerIcon />} 
                    title="Best Time" 
                    value={stats.bestTime}
                    color="warning"
                  />
                </Grid>
                <Grid item xs={6} sm={4} md={3}>
                  <StatCard 
                    icon={<StarIcon />} 
                    title="Achievements" 
                    value={`${stats.achievements}/${achievements.length}`}
                    color="secondary"
                  />
                </Grid>
              </Grid>
            </Grid>
          </Grid>
        </Paper>

        <Paper elevation={3} sx={{ p: 3, borderRadius: 2, mb: 4 }}>
          <Tabs 
            value={tabValue} 
            onChange={handleTabChange} 
            variant="scrollable"
            scrollButtons="auto"
            sx={{ mb: 3 }}
          >
            <Tab label="Overview" icon={<StatsIcon />} />
            <Tab label="Achievements" icon={<TrophiesIcon />} />
            <Tab label="Recent Games" icon={<HistoryIcon />} />
          </Tabs>

          {tabValue === 0 && (
            <Box>
              <Typography variant="h6" gutterBottom>Progress</Typography>
              <Box sx={{ mb: 4 }}>
                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
                  <Typography>Puzzle Mastery</Typography>
                  <Typography>60%</Typography>
                </Box>
                <LinearProgress variant="determinate" value={60} sx={{ height: 10, borderRadius: 5 }} />
              </Box>

              <Grid container spacing={3}>
                <Grid item xs={12} md={6}>
                  <Typography variant="h6" gutterBottom>Stats by Difficulty</Typography>
                  {['Easy', 'Medium', 'Hard'].map((difficulty) => (
                    <Box key={difficulty} sx={{ mb: 2 }}>
                      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 0.5 }}>
                        <Typography>{difficulty}</Typography>
                        <Typography>5/10 completed</Typography>
                      </Box>
                      <LinearProgress 
                        variant="determinate" 
                        value={50} 
                        sx={{ 
                          height: 8, 
                          borderRadius: 5,
                          backgroundColor: 'action.hover',
                          '& .MuiLinearProgress-bar': {
                            backgroundColor: 
                              difficulty === 'Easy' ? 'success.main' : 
                              difficulty === 'Medium' ? 'warning.main' : 'error.main'
                          }
                        }} 
                      />
                    </Box>
                  ))}
                </Grid>
                <Grid item xs={12} md={6}>
                  <Typography variant="h6" gutterBottom>Current Streak</Typography>
                  <Box sx={{ textAlign: 'center', py: 3 }}>
                    <Typography variant="h2" color="primary" sx={{ fontSize: '4rem', lineHeight: 1 }}>
                      {stats.currentStreak}
                    </Typography>
                    <Typography color="text.secondary">days in a row</Typography>
                  </Box>
                </Grid>
              </Grid>
            </Box>
          )}

          {tabValue === 1 && (
            <Box>
              <Typography variant="h6" gutterBottom>Your Achievements</Typography>
              <List>
                {achievements.map((achievement) => (
                  <AchievementItem key={achievement.id} {...achievement} />
                ))}
              </List>
            </Box>
          )}

          {tabValue === 2 && (
            <Box>
              <Typography variant="h6" gutterBottom>Recent Games</Typography>
              <List>
                {recentGames.map((game) => (
                  <ListItem 
                    key={game.id}
                    secondaryAction={
                      <Chip 
                        label={game.completed ? 'Completed' : 'Incomplete'} 
                        color={game.completed ? 'success' : 'default'} 
                        size="small"
                        variant="outlined"
                      />
                    }
                    sx={{ 
                      border: '1px solid',
                      borderColor: 'divider',
                      borderRadius: 1,
                      mb: 1,
                    }}
                  >
                    <ListItemText
                      primary={`${game.difficulty} Puzzle`}
                      secondary={`${game.time} • ${game.date}`}
                    />
                  </ListItem>
                ))}
              </List>
            </Box>
          )}
        </Paper>
      </motion.div>
    </Container>
  );
};

export default ProfilePage;
